  \"completed\"\n\t},\n\t{\n\t\t\"key\": \"access_constraints\",\n\t\t\"value\": \"[\"Use
  Constraints: Public domain data from the U.S. Government are freely redistributable
  with proper metadata and source attribution. Please recognize the U.S. Geological
  Survey (USGS) as the source of this information. Additionally, there are limitations
  associated with eologic mapping interpretations. Because of the scale and line spacing
  of the source seismic profiles, not all changes in seafloor geology are captured.
  Horizons are inferred between seismic lines, and unit exents and thicknesses should
  be considered an approximation of the location of a change in geology. Further,
  a constant seismic velocity of 1,500 m/s was assumed for all profiles in all sediment
  types, which may result in inaccurate depths of stratigraphic units.\", \"Access
